// 根据索引使选中流域变色
function setSpecialBasin(i) {
    var poyjSONArr = [];
    var mnArr = [];
    if(i == ""){
        fivePolygons.clearGeoJSON();
        map.setCenter(new fjzx.map.Point(parseFloat("117.65"),parseFloat("24.52")));
    } else {
        if (specialBasinData[i].polygon != "") {
            var points = [];
            var arr = specialBasinData[i].polygon.split(',');
            for (var j = 0; j < arr.length; j = j + 2) {
                points.push([arr[j], arr[j + 1]]);
            }
            var feature = {
                    "layout": "XY",
                    "coordinates": [points],
                    "type": "Polygon",
                    "featureId": "p" + specialBasinData[i].mn,
                    "pencilColor": "#2ba4e9",
                    "pencilSize": '0'
            };
            poyjSONArr.push({
                "feature": JSON.stringify(feature),
                "name": "",
                "id": "p_" + specialBasinData[i].mn
            });
            mnArr.push("p_" + specialBasinData[i].mn);
            
            if (fivePolygons == null) {
                fivePolygons = initDrawGeoLine(map, 'poly');
                clickAction(fivePolygons);
            }
        }
        fivePolygons.load(poyjSONArr);
        map.setCenter([ parseFloat(specialBasinData[i].lng), parseFloat(specialBasinData[i].lat) ]);
    }
    
}